            //Iterate Through Array
            foreach (double[] location in locationList)
            {
                var polylineOptions = new PolylineOptions();

                //Polyline Color
                polylineOptions.InvokeColor(getColor());

                int counterLat = 0;
                int counterLong = 1;

                for (int i = 0; i <= location.Length; i += 4)
                {
                    polylineOptions.Add(new LatLng(location[counterLong], location[counterLat]));

                    counterLat += 2;
                    counterLong += 2;
                }

                //Create Polyline
                NativeMap.AddPolyline(polylineOptions);
                polylineOptions.Dispose();
            }



        }
        //Get New Color
        private int getColor()
        {
            int newColor;
            int newRandom;
            Random rnd = new Random();

            newRandom = rnd.Next(1, 5);

            switch (newRandom)
            {
                //RED
                case 1:
                    {
                        newColor = 0x66FF0000;
                    }
                    break;
                //GREEN
                case 2:
                    {
                        newColor = 0x6B6B6B00;
                    }
                    break;
                //BLUE
                case 3:
                    {
                        newColor = 0x660000FF;
                    }
                    break;
                //ORANGE
                case 4:
                    {
                        newColor = 0x66FFA500;
                    }
                    break;
                //PINK
                case 5:
                    {
                        newColor = 0x66FFC0CB;
                    }
                    break;
                //RED
                default:
                    {
                        newColor = 0x66FF0000;
                    }
                    break;
            }

            return newColor;
        }
